namespace occ::qm::basis_sets {

std::vector<Shell>
build_sto3g_shells(const std::vector<occ::core::Atom> &atoms) {
  std::vector<Shell> shells;
  shells.reserve(atoms.size() * 10); // rough estimate

  for (const auto &atom : atoms) {
    const int atomic_num = atom.atomic_number;

    // Find shells for this element
    for (size_t i = 0; i < sto3g_data::num_shells; ++i) {
      if (sto3g_data::atomic_numbers[i] != atomic_num)
        continue;

      const int l = sto3g_data::l_values[i];
      const size_t exp_start = sto3g_data::exp_starts[i];
      const size_t coeff_start = sto3g_data::coeff_starts[i];

      // Extract exponents (always 3 for STO-3G)
      std::vector<double> exponents(sto3g_data::exponents.begin() + exp_start,
                                    sto3g_data::exponents.begin() + exp_start + 3);

      // Extract coefficients (always 3 for STO-3G)
      std::vector<double> contractions(sto3g_data::coefficients.begin() + coeff_start,
                                       sto3g_data::coefficients.begin() + coeff_start + 3);

      Shell shell(l, exponents, {contractions}, {{atom.x, atom.y, atom.z}});
      shells.push_back(std::move(shell));
    }
  }

  return shells;
}

} // namespace occ::qm::basis_sets
